const waitMs=e=>new Promise(t=>setTimeout(t,e));function goToHome(){window.location.href="/"}async function getTeamRanks(){document.getElementById("viewScoutsButton").innerHTML="Requesting Data...";let e=new XMLHttpRequest;e.open("GET","/api/scouts/me/profile",!0),e.withCredentials=!0,e.onreadystatechange=async()=>{if(e.readyState===XMLHttpRequest.DONE&&200===e.status){console.log("200 ok"),console.log(e.responseText);let t=JSON.parse(e.responseText);console.log(t)}else 401===e.status?(console.log("401 failure"),document.getElementById("viewScoutsButton").innerHTML="401 Unauthorized",await waitMs(1e3),window.location.href="/login"):400===e.status?(console.log("400 failure"),document.getElementById("viewScoutsButton").innerHTML="400 Bad Request"):500===e.status?(console.log("500 failure"),document.getElementById("viewScoutsButton").innerHTML="500 Internal Server Error"):(console.log("awaiting response"),document.getElementById("viewScoutsButton").innerHTML="Downloading Data...")},e.send()}